import React from "react";

class Entry extends React.Component {
    constructor(props){
        super(props)

    }
    render(){
        return(
            <div className="row">
                <div className="col-10">
                    {this.props.day}<br/>
                    {this.props.date}
                </div>
                <div className="col-2">
                    {this.props.hours}<br/>
                </div>
                <hr/>
            </div>  
        )
    }
}

export default Entry;
